        {
            if((alarmFlag != null) && (alarmFlag.GetFlag() != false))
            {
                //System.Windows.Forms.MessageBox.Show("Clicked.");
                is_attacked.SetFlag(true);
            }
        }

        void pictureBox_VehicleSkin_Paint(object sender, System.Windows.Forms.PaintEventArgs e)
        {
            if((this._FrontLight != null) && (this._SalonLight != null))
            {
                e.Graphics.DrawImage(this._FrontLight, 0, 0, 483, 668);
                e.Graphics.DrawImage(this._SalonLight, 0, 0, 483, 668);
            }
            else if(this._FrontLight != null)
                e.Graphics.DrawImage(this._FrontLight, 0, 0, 483, 668);
            else if(this._SalonLight != null)
                e.Graphics.DrawImage(this._SalonLight, 0, 0, 483, 668);
        }

